import React, { Component } from 'react';

class Home extends Component{
    render() {
        
        return (

            <div>
                <h1>home</h1>
                <video playsinline="playsinline" autoplay="autoplay" muted="muted" loop="loop">
                <source src="dsdoijfeijowiooij.mp4" type="video/mp4"/>
                </video>
            </div>


        );
    }
}

export default Home;
